160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1,_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%BE%D1%80\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431, \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\">\u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440 \u041a\u043e\u043b\u0443\u043c\u0431<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0432 \u0441\u0432\u043e\u0451 \u0442\u0440\u0435\u0442\u044c\u0435 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1520_%D0%B3%D0%BE%D0%B4\" title=\"1520 \u0433\u043e\u0434\">1520<\/a>&#160;\u2014 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B5\" title=\"\u041a\u0430\u043b\u0435\">\u041a\u0430\u043b\u0435<\/a> \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0438\u0441\u044c \u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_VIII\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 VIII\">\u0413\u0435\u043d\u0440\u0438\u0445 VIII<\/a> \u0438 \u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a I (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a I<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0443\u0441\u0442\u0440\u043e\u0438\u043b\u0438 \u0442\u0440\u0451\u0445\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u044b\u0439 \u043f\u0438\u0440 \u0441 10 \u0442\u044b\u0441\u044f\u0447\u0430\u043c\u0438 \u043f\u0440\u0438\u0434\u0432\u043e\u0440\u043d\u044b\u0445 (\u044d\u0442\u043e\u0442 \u043f\u0438\u0440 \u0