5\u0442\u0438\u0446\u0438\u044f \u043e \u043f\u0440\u0430\u0432\u0435<\/a> \u043e\u0434\u0438\u043d \u0438\u0437 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Fundamental_Laws_of_England\" class=\"extiw\" title=\"en:Fundamental Laws of England\">\u0444\u0443\u043d\u0434\u0430\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0437\u0430\u043a\u043e\u043d\u043e\u0432 \u0410\u043d\u0433\u043b\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B0%D0%BD%D0%BA%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u0441\u0430\u043d\u043a\u0446\u0438\u044f\">\u043e\u0434\u043e\u0431\u0440\u0435\u043d<\/a> \u043a\u043e\u0440\u043e\u043b\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b I (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u0427\u0430\u0440\u043b\u044c\u0437\u043e\u043c I<\/a> \u0438 \u0441\u0442\u0430\u043b \u0437\u0430\u043a\u043e\u043d\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1640_%D0%B3%D0%BE%D0%B4\" title=\"1640 \u0433\u043e\u0434\">1640<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D0%BE%D0%BD%D0%B0\" title=\"\u0411\u0430\u0440\u0441\u0435\u043b\u043e\u043d\u0430\">\u0411\u0430\u0440\u0441\u0435\u043b\u043e\u043d\u0435<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0435 \u043a\u0430\u043a <a href=\"https:\/\/es.wikipedia.org\/wiki\/Corpus_de_Sangre\" class=\"extiw\" title=\"es:Corpus de Sangre\">Corpus de Sangre<\/a>&#160;\u2014 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u043a\u0430\u0442\u0430\u043b\u043e\u043d\u0441\u043a\u0438\u0445 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d \u043f\u0440\u043e\u0442\u0438\u0432 \u041a\u043e\u0440\u043e\u043d\u044b. \u0423\u0431\u0438\u0442 \u0432\u0438\u0446\u0435-\u043a\u043e\u0440\u043e\u043b\u044c \u0438 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0445 \u0447\u0438\u043d\u043e\u0432\u043d\u0438\u043a\u043e\u0432. \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B3%D0%B0%D0%B4%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0421\u0435\u0433\u0430\u0434\u043e\u0440\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u0421\u0435\u0433\u0430\u0434\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1654_%D0%B3%D0%BE%D0%B4\" title=\"1654 \u0433\u043e\u0434\">1654<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043d\u043e\u0432\u0430\u043d \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XIV\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XIV\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a XIV<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1684_%D0%B3%D0%BE%D0%B4\" title=\"1684 \u0433\u043e\u0434\">1684<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/en.wikipedia.org\/wiki\/War_of_the_Reunions\" class=\"extiw\" title=\"en:War of the Reunions\">\u0412\u043e\u0439\u043d\u044b \u0437\u0430 \u0412\u043e\u0441\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 \u0418\u0441\u043f\u0430\u043d\u0438\u0435\u0439 \u0438 \u0424\u0440\u0430\u043d\u0446\u0438\u0435\u0439 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Siege_of_Luxembourg_(1684)\" class=\"extiw\" title=\"en:Siege of Luxembourg (1684)\">\u0432\u0437\u044f\u0442 \u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433<\/a>. \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043e\u043d \u043e\u0442\u043e\u0448\u0451\u043b \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u043f\u043e <a href=\"https:\/\/de.wikipedia.org\/wiki\/Regensburger_Stillstand\" class=\"extiw\" title=\"de:Regensburger Stillstand\">\u0420\u0435\u0433\u0435\u043d\u0441\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u043c\u0443 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1692_%D0%B3%D0%BE%D0%B4\" title=\"1692 \u0433\u043e\u0434\">1692<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0_%D0%AF%D0%BC%D0%B0%D0%B9%D0%BA%D0%B5_(1692)\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u043d\u0430 \u042f\u043c\u0430\u0439\u043a\u0435 (1692)\">\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u043d\u0430 \u042f\u043c\u0430\u0439\u043a\u0435<\/a> \u0432\u044b\u0437\u0432\u0430\u0432\u0448\u0435\u0435 \u0446\u0443\u043d\u0430\u043c\u0438, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u043b\u043e \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82-%D0%A0%D0%BE%D0%B9%D0%B0%D0%BB\" title=\"\u041f\u043e\u0440\u0442-\u0420\u043e\u0439\u0430\u043b\">\u041f\u043e\u0440\u0442-\u0420\u043e\u0439\u0430\u043b<\/a> \u0433\u043b\u0430\u0432\u043d\u0443\u044e \u043f\u0438\u0440\u0430\u0442\u0441\u043a\u0443\u044e \u0431\u0430\u0437\u0443 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B8%D0%B1%D1%81%D0%BA%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u041a\u0430\u0440\u0438\u0431\u0441\u043a\u043e\u0435 \u043c\u043e\u0440\u0435\">\u041a\u0430\u0440\u0438\u0431\u0441\u043a\u043e\u043c \u043c\u043e\u0440\u0435<\/a>. \u041d\u0430\u0447\u0430\u043b\u0441\u044f \u0437\u0430\u043a\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%80%D0%B0%D1%82%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%9A%D0%B0%D1%80%D0%B8%D0%B1%D1%81%D0%BA%D0%BE%D0%BC_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u041f\u0438\u0440\u0430\u0442\u0441\u0442\u0432\u043e \u0432 \u041a\u0430\u0440\u0438\u0431\u0441\u043a\u043e\u043c \u043c\u043e\u0440\u0435\">\u044d\u043f\u043e\u0445\u0438 \u043f\u0438\u0440\u0430\u0442\u0441\u0442\u0432\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%81%D1%82-%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0412\u0435\u0441\u0442-\u0418\u043d\u0434\u0438\u044f\">\u0412\u0435\u0441\u0442-\u0418\u043d\u0434\u0438\u0438<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1732_%D0%B3%D0%BE%D0%B4\" title=\"1732 \u0433\u043e\u0434\">1732<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0437\u0430\u043b\u043e\u0436\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0417\u0438\u043c\u043d\u0438\u0439 \u0434\u0432\u043e\u0440\u0435\u0446, \u0441\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0439 \u0434\u043b\u044f \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b \u0410\u043d\u043d\u044b \u0418\u043e\u0430\u043d\u043d\u043e\u0432\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1753_%D0%B3%D0%BE%D0%B4\" title=\"1753 \u0433\u043e\u0434\">1753<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043e\u0440\u0433 II (\u043a\u043e\u0440\u043e\u043b\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438)\">\u0413\u0435\u043e\u0440\u0433 II<\/a> \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u043b \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u043e \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u0438\u0438 \u0432 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0443\u044e \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u043a\u043e\u043b\u043b\u0435\u043a\u0446\u0438\u0438 \u043f\u043e\u043a\u043e\u0439\u043d\u043e\u0433\u043e \u0441\u044d\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%BE%D0%B0%D0%BD,_%D0%93%D0%B0%D0%BD%D1%81\" title=\"\u0421\u043b\u043e\u0430\u043d, \u0413\u0430\u043d\u0441\">\u0425\u044d\u043d\u0441\u0430 \u0421\u043b\u043e\u0443\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1775_%D0%B3%D0%BE%D0%B4\" title=\"1775 \u0433\u043e\u0434\">1775<\/a>&#160;\u2014 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u041a\u043e\u043b\u043e\u043d\u0438\u0438 (United Colonies) \u043c\u0435\u043d\u044f\u044e\u0442 \u0441\u0432\u043e\u0451 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b (United States).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1776_%D0%B3%D0%BE%D0%B4\" title=\"1776 \u0433\u043e\u0434\">1776<\/a>&#160;\u2014 \u0432\u0441\u0435 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435 \u043a\u043e\u043b\u043e\u043d\u0438\u0438 \u0410\u043c\u0435\u0440\u0438\u043a\u0438, \u043a\u0440\u043e\u043c\u0435 \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430, \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043b\u0438 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u0438\u0437\u0434\u0430\u043d\u0438\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043e\u0441\u043e\u0431\u044b\u0445 \u043f\u0440\u0430\u0432\u0438\u043b, \u043e\u0442\u0434\u0430\u044e\u0449\u0438\u0445 \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u0432 \u043f\u043e\u0434 \u0434\u0432\u043e\u0439\u043d\u043e\u0439 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c&#160;\u2014 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0447\u0430\u043b\u044c\u0441\u0442\u0432\u0430 \u0438 \u043f\u043e\u043b\u0438\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1872_%D0%B3%D0%BE%D0%B4\" title=\"1872 \u0433\u043e\u0434\">1872<\/a>&#160;\u2014 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043d\u0430\u0447\u0430\u0442\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043f\u0435\u0440\u0432\u043e\u0439 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%BA%D0%B0\" title=\"\u041a\u043e\u043d\u043a\u0430\">\u043a\u043e\u043d\u043d\u043e-\u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1880_%D0%B3%D0%BE%D0%B4\" title=\"1880 \u0433\u043e\u0434\">1880<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D1%82%D0%B8%D1%85%D0%BE%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0442\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_de_Arica\" class=\"extiw\" title=\"es:Batalla de Arica\">\u0431\u0438\u0442\u0432\u0430 \u0437\u0430 \u0410\u0440\u0438\u043a\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%B7%D0%B0_%D0%90%D1%80%D0%B8%D0%BA%D1%83&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0438\u0442\u0432\u0430 \u0437\u0430 \u0410\u0440\u0438\u043a\u0443 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0440\u0443\u0441\u0441\u043a.<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u0432\u0437\u044f\u0442\u0438\u0435\u043c \u0433\u043e\u0440\u043e\u0434\u0430 \u0438 \u0435\u0433\u043e \u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0435\u0439 \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0427\u0438\u043b\u0438\">\u0427\u0438\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1883_%D0%B3%D0%BE%D0%B4\" title=\"1883 \u0433\u043e\u0434\">1883<\/a>&#160;\u2014 \u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D0%B0%D0%BC_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%B0_%D0%A1%D0%BF%D0%B0%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8F\" title=\"\u0425\u0440\u0430\u043c \u0425\u0440\u0438\u0441\u0442\u0430 \u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044f\">\u0425\u0440\u0430\u043c\u0430 \u0425\u0440\u0438\u0441\u0442\u0430 \u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0443\u0447\u0451\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8E%D1%80%D0%B8,_%D0%9F%D1%8C%D0%B5%D1%80\" title=\"\u041a\u044e\u0440\u0438, \u041f\u044c\u0435\u0440\">\u041f\u044c\u0435\u0440 \u041a\u044e\u0440\u0438<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e\u0431 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 \u043d\u043e\u0432\u043e\u0433\u043e \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430&#160;\u2014 \u043f\u043e\u043b\u043e\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0440\u0430\u0441\u0442\u043e\u0440\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%BE-%D0%BD%D0%BE%D1%80%D0%B2%D0%B5%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D1%83%D0%BD%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0434\u0441\u043a\u043e-\u043d\u043e\u0440\u0432\u0435\u0436\u0441\u043a\u0430\u044f \u0443\u043d\u0438\u044f\">\u0428\u0432\u0435\u0434\u0441\u043a\u043e-\u041d\u043e\u0440\u0432\u0435\u0436\u0441\u043a\u043e\u0439 \u0443\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u043f\u0430\u0440\u0442\u0438\u044f \u044d\u0441\u0435\u0440\u043e\u0432 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0440\u0430\u0441\u043a\u043e\u043b\u043e\u043b\u0430\u0441\u044c \u043d\u0430 \u043f\u0440\u0430\u0432\u044b\u0445 \u0438 \u043b\u0435\u0432\u044b\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u044b \u043f\u0438\u0441\u044c\u043c\u0435\u043d\u043d\u044b\u0435 \u0442\u0435\u0441\u0442\u044b \u0434\u043b\u044f \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u044f \u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0445 \u043f\u0440\u0430\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d \u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F\" title=\"\u0420\u0443\u043c\u044b\u043d\u0438\u044f\">\u0420\u0443\u043c\u044b\u043d\u0438\u0435\u0439<\/a> \u0438 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\u043c \u0441\u0435\u0440\u0431\u043e\u0432, \u0445\u043e\u0440\u0432\u0430\u0442\u043e\u0432 \u0438 \u0441\u043b\u043e\u0432\u0435\u043d\u0446\u0435\u0432 (\u0431\u0443\u0434\u0443\u0449\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u041b\u0430\u0442\u0435\u0440\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f\u043c\u0438 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a><ul><li>\u041f\u0435\u0440\u0432\u0430\u044f \u043f\u044c\u0435\u0441\u0430, \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u043d\u0430\u044f \u043f\u043e \u0442\u0435\u043b\u0435\u0432\u0438\u0437\u043e\u0440\u0443 \u0441 \u043e\u0440\u0438\u0433\u0438\u043d\u0430\u043b\u044c\u043d\u044b\u043c \u0431\u0440\u043e\u0434\u0432\u0435\u0435\u0432\u0441\u043a\u0438\u043c \u0441\u043e\u0441\u0442\u0430\u0432\u043e\u043c \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u0435\u0439, \u00ab\u0421\u044e\u0437\u0430\u043d\u043d\u0430 \u0438 \u0411\u043e\u0433\u00bb.<\/li><li>\u041d\u0430\u0446\u0438\u0441\u0442\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u043e, \u0447\u0442\u043e \u0432\u0441\u0435 \u0436\u0435\u043b\u0430\u044e\u0449\u0438\u0435 \u0432\u0441\u0442\u0443\u043f\u0438\u0442\u044c \u0432 \u0431\u0440\u0430\u043a \u043e\u0431\u044f\u0437\u0430\u043d\u044b \u0434\u043e\u043a\u0430\u0437\u0430\u0442\u044c \u0441\u0432\u043e\u0451 \u0430\u0440\u0438\u0439\u0441\u043a\u043e\u0435 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b \u0441\u0442\u0440\u0430\u043d\u044b \u0432\u044b\u0448\u0435\u043b \u0444\u0438\u043b\u044c\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BE%D0%BC,_%D0%90%D0%B1%D1%80%D0%B0%D0%BC_%D0%9C%D0%B0%D1%82%D0%B2%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0420\u043e\u043e\u043c, \u0410\u0431\u0440\u0430\u043c \u041c\u0430\u0442\u0432\u0435\u0435\u0432\u0438\u0447\">\u0410\u0431\u0440\u0430\u043c\u0430 \u041c\u0430\u0442\u0432\u0435\u0435\u0432\u0438\u0447\u0430 \u0420\u043e\u043e\u043c\u0430<\/a> \u00ab\u042d\u0441\u043a\u0430\u0434\u0440\u0438\u043b\u044c\u044f \u2116&#160;5\u00bb (\u00ab\u0412\u043e\u0439\u043d\u0430 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f\u00bb), \u043f\u043e\u0432\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u043e \u0433\u0440\u044f\u0434\u0443\u0449\u0435\u0439 \u0432\u043e\u0439\u043d\u0435 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430 \u0441 \u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439 (\u041a\u0438\u0435\u0432\u0441\u043a\u0430\u044f \u043a\u0438\u043d\u043e\u0441\u0442\u0443\u0434\u0438\u044f, 1939). \u0424\u0438\u043b\u044c\u043c \u043f\u0440\u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0441\u044f \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0434\u043d\u0435\u0439, \u0442\u0430\u043a \u043a\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE-%D0%B3%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\">\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f<\/a> \u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0443\u043b\u0443\u0447\u0448\u0438\u043b\u0438\u0441\u044c \u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u043f\u0440\u043e\u043f\u0430\u0433\u0430\u043d\u0434\u0430 \u0440\u0435\u0448\u0438\u043b\u0430 \u043d\u0435 \u0440\u0430\u0437\u0434\u0440\u0430\u0436\u0430\u0442\u044c \u0413\u0438\u0442\u043b\u0435\u0440\u0430. \u0412 \u0444\u0438\u043b\u044c\u043c\u0435 \u0438\u0433\u0440\u0430\u043b\u0438 \u0430\u043a\u0442\u0451\u0440\u044b: \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0413\u0430\u0440\u0438\u043d, \u042e\u0440\u0438\u0439 \u0428\u0443\u043c\u0441\u043a\u0438\u0439, \u0410\u043d\u0434\u0440\u0435\u0439 \u0410\u043f\u0441\u043e\u043b\u043e\u043d, \u0421\u0435\u0440\u0433\u0435\u0439 \u0426\u0435\u043d\u0438\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u0432\u043e\u0437\u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e\u0433\u043e \u0442\u0435\u043b\u0435\u0432\u0435\u0449\u0430\u043d\u0438\u044f \u0411\u0438-\u0431\u0438-\u0441\u0438. \u041f\u0435\u0440\u0435\u0434\u0430\u0447\u0438 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u044e\u0442 \u043c\u0435\u043d\u0435\u0435 12 \u0442\u044b\u0441\u044f\u0447 \u0442\u0435\u043b\u0435\u0437\u0440\u0438\u0442\u0435\u043b\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0430 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B5%D1%88,_%D0%AD%D0%B4%D0%B2%D0%B0%D1%80%D0%B4\" title=\"\u0411\u0435\u043d\u0435\u0448, \u042d\u0434\u0432\u0430\u0440\u0434\">\u0411\u0435\u043d\u0435\u0448\u0430<\/a> \u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0436\u0438\u043c\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b\u043e \u0441 \u043c\u0435\u043c\u043e\u0440\u0430\u043d\u0434\u0443\u043c\u043e\u043c \u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u043a\u0430\">\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u043a\u0435<\/a>, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u043c \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u043b\u0430\u043d\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0440\u0435\u0448\u0438\u0442\u044c \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443 \u00ab\u041b\u0435\u0434\u044f\u043d\u043e\u0433\u043e \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u00bb \u0432 \u0443\u0437\u043a\u043e\u043c \u043a\u0440\u0443\u0433\u0443 \u0437\u0430\u043f\u0430\u0434\u043d\u044b\u0445 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432. \u0412 \u043c\u0435\u043c\u043e\u0440\u0430\u043d\u0434\u0443\u043c\u0435 \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u043e\u0441\u044c \u043e \u043d\u0435\u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0438 \u043d\u0438\u043a\u0430\u043a\u0438\u0445 \u0440\u0435\u0448\u0435\u043d\u0438\u0439 \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u044b, \u043f\u0440\u0438\u043d\u044f\u0442\u044b\u0445 \u0431\u0435\u0437 \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0421\u0421\u0421\u0420, \u0438 \u0443\u043f\u043e\u043c\u0438\u043d\u0430\u043b\u0441\u044f \u043f\u0440\u0438\u043e\u0440\u0438\u0442\u0435\u0442 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0439 \u0432 \u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u043a\u0435. \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e\u0431 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0438 \u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u043a\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u043c\u0438\u0440\u043d\u044b\u0445 \u0446\u0435\u043b\u044f\u0445 \u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u0435 \u043d\u0430\u0443\u0447\u043d\u044b\u0445 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u0448\u0435\u0441\u0442\u043e\u043c \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0435 \u0431\u044b\u043b \u0437\u0430\