\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8F\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0418\u0437\u0440\u0430\u0438\u043b\u044f\">\u0412\u0412\u0421 \u0418\u0437\u0440\u0430\u0438\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%C2%BB\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u041e\u043f\u0435\u0440\u0430\u00bb\">\u043d\u0430\u043d\u0435\u0441\u043b\u0438 \u0431\u043e\u043c\u0431\u043e\u0432\u044b\u0439 \u0443\u0434\u0430\u0440<\/a> \u043f\u043e \u0438\u0440\u0430\u043a\u0441\u043a\u043e\u043c\u0443 \u044f\u0434\u0435\u0440\u043d\u043e\u043c\u0443 \u0440\u0435\u0430\u043a\u0442\u043e\u0440\u0443 \u0432 \u041e\u0441\u0438\u0440\u0430\u043a\u0435 \u0438 \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u043b\u0438 \u0435\u0433\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-8_%D0%BF%D0%BE%D0%B4_%D0%9F%D0%B0%D1%80%D0%B0%D0%BC%D0%B0%D1%80%D0%B8%D0%B1%D0%BE\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-8 \u043f\u043e\u0434 \u041f\u0430\u0440\u0430\u043c\u0430\u0440\u0438\u0431\u043e\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-8 \u043f\u043e\u0434 \u041f\u0430\u0440\u0430\u043c\u0430\u0440\u0438\u0431\u043e<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 176 \u0447\u0435\u043b\u043e\u0432\u0435\u043a&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u